          Axios.get("http://localhost:3001/CustomerPageRestaurant",{
            name:localStorage.getItem("customer")
          })
          .then((response) =>{
            const allProfileData = response.data.customer;
            getProfileData(allProfileData)
          }).catch(err =>
            console.log(err))
        }

  return (

              <Fragment key={profileData.id}>
                      <CustomerProfile customerInfo={profileData} />
